import { ToolService } from 'src/app/shared/services/tool.service';
let FormMenuComponent = class FormMenuComponent {
    constructor(toolService, modalService) {
        this.toolService = toolService;
        this.modalService = modalService;
        this.optionType = 1;
        this.options = {
            size: 'lg',
            backdrop: 'static',
            keyboard: false,
            centered: true
        };
    }
    ngOnInit() {
        //this.grids$ = new BootstrapGridSystemService().getGrid();
        this.bootstrap = [{
                grid: [
                    `12`,
                    `6 6`,
                    `3 4 5`,
                    `4 4 4`,
                    `7 5`
                ].join("\n")
            }];
        this.tools$ = this.toolService
            .getTools()
            .pipe(map(res => {
            return res.tools;
        }));
        this.pageModel = [{
                rows: [],
                name: "Salt - A tool for Lazy Developer"
            }];
    }
    createChoices() {
        this.modalService.open(ConfigChoicesComponent, this.options);
    }
    editChoices(content) {
        let m = this.modalService.open(ConfigChoicesComponent, this.options);
        m.componentInstance.content = content;
    }
